@ok_computer: he probably sits there all day, pale blue light from the monitor illuminating his already pallid face and pockmarked complexion; pulling his pud in anticipation, waiting for the magic time of the day when jwhitt uploads our daily dose of sanity, Rush Limbaugh!

Truth detector, bullshit reflector and with half his brain tied behind his back just to make it fair! LOL!

I wouldn't mind a coffee myself: double double on the double! :)
